import React from "react";

const Home = () => {
  return (
    <>
      <div className="h-4 border-2 border-red-600">
        <img className="h-full w-full" alt="main_image" src="/images/main-image.png" />
      </div>
      <p>HOME</p>
    </>
  );
};

export default Home;
